import { useDispatch, useSelector } from "react-redux";
import AdminPageWrapper from "./AdminPageWrapper";
import { useNavigate } from "react-router-dom";

function AdminDashboard() {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  //   const handleLogout = () => {
  //     localStorage.removeItem("userData");
  //     dispatch(unsuscribeUser)
  //     localStorage.removeItem("token");
  //     dispatch(unsuscribeToken)
  //     localStorage.removeItem("email");
  //     dispatch(unsuscribeEmail)
  //     navigate("/login");
  //   };

  // const userData = JSON.parse(localStorage.getItem("userData"));

  const userData = useSelector((state) => state.allUser);

  function dataMap(userData) {
    userData.map((items) => {
      return (
        <tr>
          <td>{items.name}</td>
          <td>
            <img src={items.image} alt="imagxcvxve" />
          </td>
          <td>items.email</td>
          <td>
            <button>Edit</button>
          </td>
          <td>
            <button>Delete</button>
          </td>
        </tr>
      );
    });
  }

  return (
    <AdminPageWrapper>
      <div>
        <table className="table table-bordered border text-white">
          <thead>
            <th className="border">Name</th>
            <th className="border">Image</th>
            <th className="border">E-mail</th>
            <th className="border">Edit</th>
            <th className="border">Delete</th>
          </thead>
          <tbody>
            {dataMap(userData)}
          </tbody>
        </table>
      </div>
    </AdminPageWrapper>
  );
}

export default AdminDashboard;
